package common

import (
	"encoding/base64"
	"fmt"
	"log"
)

func init() {
	var err error
	Rikka, err = base64.StdEncoding.DecodeString(rikka)
	if err != nil {
		log.Fatal(err)
	}
	RikkaLength = fmt.Sprint(len(Rikka))

	Icon, err = base64.StdEncoding.DecodeString(icon)
	if err != nil {
		log.Fatal(err)
	}
	IconLength = fmt.Sprint(len(Icon))
}

var (
	Rikka       []byte
	RikkaLength string
	Icon        []byte
	IconLength  string
)

